import { useNavigate } from "react-router-dom";
import React, { useState } from 'react';
import { Heart, Star, Search, Instagram, Facebook, Twitter, Linkedin } from 'lucide-react';

// ProductCard Component - Represents a single product card
const ProductCard = ({ price, discount, description ,}) => {
    const navigate = useNavigate();
 return ( 
    <div className="w-full sm:w-[262px] h-[373px] bg-white p-[20px] rounded-[18px] shadow-md flex flex-col  
    "onClick={() => navigate("/ProductDetails")}>
        {/* Favorite button and discount tag */}
        <div className="relative flex-1">
            <button className="absolute left-2 top-2 z-10">
                <Heart className="w-6 h-6 text-gray-400" />
            </button>
            <span className="absolute right-2 top-2 bg-orange-500 text-white text-sm px-2 py-1 rounded-md z-10">
                {discount}
            </span>
            {/* Product Image */}
            <div className="rounded-lg p-4 flex justify-center items-center">
                <img
                    src="/envato-labs-image-edit (8) 1.png"
                    alt="Product"
                    className="w-[100px] h-[150px] object-contain"
                />
            </div>
        </div>
        {/* Product details: Rating, Description, Price, Add to Cart Button */}
        <div className="mt-2 px-2 flex flex-col justify-between flex-1">
            <div className="flex mb-1">
                {[1, 2, 3, 4, 5].map((_, index) => (
                    <Star
                        key={index}
                        className={`w-4 h-4 ${index < 4 ? 'text-yellow-400 fill-yellow-400' : 'text-gray-300'}`}
                    />
                ))}
            </div>
            <p className="text-gray-700 text-sm mb-1">{description}</p>
            <p className="text-lg font-bold text-gray-900 mb-3">₹{price}</p>
            <button className="w-full h-[38px] bg-orange-400 hover:bg-orange-500 text-white rounded-full transition-colors">
                Add To Cart
            </button>
        </div>
    </div>
);
};

// StorePage Component - The main store page layout
const StorePage = () => {
    // Mock product data
    const products = Array(12).fill({ price: 550, discount: '30%', description: 'Lorem ipsum dolor sit amet consectetur.' });

    return (
        <div className="px-20 py-10 bg-[#F5F6ED] min-h-screen">
            {/* Header Section with Title and Search Bar */}
            <header className="flex justify-between items-center mb-6 sm:mb-4">
                <h1 className="text-3xl font-bold hidden sm:block">Store</h1>
                <div className="relative w-full sm:w-auto">
                    <input
                        className=" p-2 pl-12 rounded-[40px] h-[40px] w-full sm:w-64 "
                        type="text"
                        placeholder="Search"
                    />
                    <Search className="absolute  left-0.5 top-1/2 transform -translate-y-1/2 text-black w-9 h-9 bg-[#FF9B57] rounded-full p-1" />
                </div>
            </header>
            {/* Sidebar and Product Grid */}
            <div className="flex flex-wrap gap-10">
                <aside className="w-[180px] hidden md:block">
                    <h2 className="text-[18px] mb-4">Pet Type</h2>
                    <div className="space-y-4">
                        <div className="mb-6">
                            <div>
                                {['Cats', 'Dogs', 'Birds', 'Fish'].map((pet, index) => (
                                    <label key={index} className="flex items-center">
                                        <input type="radio" name="petType" className="mr-2" />
                                        <span>{pet}</span>
                                        <span className="ml-auto text-gray-500">{Math.floor(Math.random() * 150)}</span>
                                    </label>
                                ))}
                            </div>
                        </div>
                        <div className="mb-6">
                            <h3 className="font-semibold mb-3">Product Type</h3>
                            <div className="space-y-2">
                                {['Food', 'Accessories', 'Cloth', 'Toys'].map(type => (
                                    <details key={type} className="cursor-pointer">
                                        <summary className="flex items-center justify-between">
                                            {type}
                                            <span className="text-gray-400">›</span>
                                        </summary>
                                    </details>
                                ))}
                            </div>
                        </div>
                    </div>
                    <PriceRangeSlider />
                </aside>
                <main className="flex-1 grid grid-cols-1 sm:grid-cols-1 lg:grid-cols-4 gap-6 ">
                    {products.map((product, index) => (
                        <ProductCard key={index} {...product} />
                    ))}
                </main>
            </div>



            <footer className="w-full p-4 md:p-8">
                <div className="max-w-6xl mx-auto flex flex-col items-center gap-4 md:gap-6">
                    {/* Pagination */}
                    <div className="flex gap-2 pt-[65px]">
                        {[1, 2, 3, '...', 10].map((num, i) => (
                            <button
                                key={i}
                                className={`w-8 h-8 rounded-full flex items-center justify-center 
                ${num === 1 ? 'bg-[#FF9B57] text-white' : 'hover:bg-gray-100'}`}
                            >
                                {num}
                            </button>
                        ))}
                    </div>

                    {/* Logo */}
                    <img
                        src="logo png 2.png"
                        alt="Logo"
                        className="h-16 w-16 md:h-[120px] md:w-[120px]"
                    />

                    {/* Text */}
                    <p className="text-black text-center px-4">
                        Lorem ipsum dolor sit amet consectetur. Id sem
                    </p>

                    {/* Social Links */}
                    <div className="flex gap-4 md:gap-6">
                        {[Instagram, Facebook, Twitter, Linkedin].map((Icon, i) => (
                            <a
                                key={i}
                                href="#"
                                className="text-black hover:text-gray-900"
                            >
                                <Icon size={24} />
